import logofull from './images/logofull.png';
import './AdminHome.js';
function AdminHome(){
    return(
        <div class="main">
            <header>
                <div class="logo">
                    <img src = {logofull} alt=""></img>
                </div>
            </header>
        </div>
    );
}

export default AdminHome;
